import React, {Component} from 'react';
import stylesheet from './styles.js'
import Button from './Button';



function Home() {

		return (

			<div style={stylesheet.body}>
				<h1 style={stylesheet.homemain}>Welcome to Star Coder</h1>
				<Button path="/interest" />
			</div>
		);


}


export default Home;
